   "source": [
    "# --- ЧАСТЬ 1: ЗАГРУЗКА И ПОДГОТОВКА ШИРОКОГО НАБОРА ---\n",
    "library(haven)\n",
    "library(dplyr)\n",
    "library(ggplot2)\n",
    "library(reshape2)\n",
    "\n",
    "# 1. Загрузка \n",
    "df <- read_sav(\"/kaggle/input/kursovaya/r33i_os_84.sav\") \n",
    "\n",
    "# 2. Сборка всех переменных в кучу\n",
    "df_wide <- df %>%\n",
    "  filter(cc_age >= 7 & cc_age < 18) %>% # Только школьники\n",
    "  select(\n",
    "    # --- Y: Целевая ---\n",
    "    health_score = ccm3,     # 1=Супер ... 5=Плохо\n",
    "    \n",
    "    # --- X1: Биология ---\n",
    "    age = cc_age,\n",
    "    weight = ccm1,\n",
    "    height = ccm2,\n",
    "    \n",
    "    # --- X2: Школа ---\n",
    "    grades = cck3.5,         # Оценки\n",
    "    class_size = cck3.2,     # Размер класса (Моя добавка)\n",
    "    \n",
    "    # --- X3: Гаджеты и Контроль ---\n",
    "    internet = ccj123,       # Пользуется интернетом? (Моя)\n",
    "    has_phone = ccj125.1,    # Есть телефон? (Моя)\n",
    "    screen_limit = cck27,    # Ограничивают время? (Твоя)\n",
    "    \n",
    "    # --- X4: Социализация и Спорт ---\n",
    "    sport_freq = cck7.5,     # Кружки/секции\n",
    "    pe_lessons = cck7.1,     # Ходит на физру? (Твоя)\n",
    "    friends_meet = cck8.20,  # Гуляет с друзьями? (Твоя)\n",
    "    \n",
    "    # --- X5: Медицина и Болезни ---\n",
    "    hospital_3m = ccl20,     # Больница (Твоя)\n",
    "    minor_illness = ccl5.1,  # Недомогание (Твоя - очень важная!)\n",
    "    checkup = ccl26,         # Профосмотр (Моя)\n",
    "    \n",
    "    # --- X6: Среда ---\n",
    "    region,\n",
    "    status\n",
    "  ) %>%\n",
    "  # Чистка \"Отказов\" (>9000 -> NA)\n",
    "  mutate(across(everything(), ~ifelse(. > 9000, NA, .))) %>%\n",
    "  # Умное заполнение пропусков (Imputation), чтобы не терять людей\n",
    "  mutate(\n",
    "    sport_freq = ifelse(is.na(sport_freq), 0, sport_freq),     # Если нет ответа - не занимается\n",
    "    friends_meet = ifelse(is.na(friends_meet), 3, friends_meet), # Медиана\n",
    "    minor_illness = ifelse(is.na(minor_illness), 2, minor_illness) # Если нет ответа - не болел (код 2)\n",
    "  ) %>%\n",
    "  na.omit() # Удаляем остатки (где совсем нет данных)\n",
    "\n",
    "# 3. ЦИФРОВИЗАЦИЯ (Feature Engineering для корреляции)\n",
    "df_numeric <- df_wide %>%\n",
    "  mutate(\n",
    "    # Считаем BMI\n",
    "    bmi = weight / ((height/100)^2),\n",
    "    \n",
    "    # Бинарные переменные: превращаем 1/2 в 1/0\n",
    "    # 1=Да -> 1, 2=Нет -> 0\n",
    "    limit_bin    = ifelse(screen_limit == 1, 1, 0),\n",
    "    pe_bin       = ifelse(pe_lessons == 1, 1, 0),\n",
    "    illness_bin  = ifelse(minor_illness == 1, 1, 0),\n",
    "    hospital_bin = ifelse(hospital_3m == 1, 1, 0),\n",
    "    checkup_bin  = ifelse(checkup == 1, 1, 0),\n",
    "    internet_bin = ifelse(internet == 1, 1, 0),\n",
    "    phone_bin    = ifelse(has_phone == 1, 1, 0),\n",
    "    \n",
    "    # Шкалы: Инвертируем оценки, чтобы график был логичным\n",
    "    # Исходно: 1=Пятерка. Станет: 5=Пятерка.\n",
    "    grades_inv = 6 - grades \n",
    "  ) %>%\n",
    "  # Оставляем только числа для матрицы\n",
    "  select(health_score, bmi, age, grades_inv, class_size,\n",
    "         sport_freq, friends_meet, limit_bin, pe_bin, \n",
    "         illness_bin, hospital_bin, checkup_bin, \n",
    "         internet_bin, phone_bin, status)\n",
    "\n",
    "# 4. МАТРИЦА КОРРЕЛЯЦИЙ\n",
    "cor_matrix <- cor(df_numeric)\n",
    "\n",
    "# Выводим Топ факторов по влиянию на здоровье\n",
    "# Напоминаю: health_score (1-5), где 5 - это ПЛОХО.\n",
    "# Положительная корр = Вредит здоровью. Отрицательная = Полезна.\n",
    "print(\"--- РЕЙТИНГ ВЛИЯНИЯ НА ЗДОРОВЬЕ (КОРРЕЛЯЦИЯ) ---\")\n",
    "print(sort(cor_matrix[,\"health_score\"], decreasing = FALSE))\n",
    "\n",
    "# 5. ГРАФИК HEATMAP\n",
    "melted_cor <- melt(cor_matrix)\n",
    "ggplot(data = melted_cor, aes(x=Var1, y=Var2, fill=value)) + \n",
    "  geom_tile() +\n",
    "  scale_fill_gradient2(low = \"blue\", high = \"red\", mid = \"white\", limit = c(-1,1), name=\"Corr\") +\n",
    "  theme_minimal() +\n",
    "  theme(axis.text.x = element_text(angle = 90, vjust = 0.5, hjust=1)) +\n",
    "  labs(title = \"Финальная карта факторов\", subtitle = \"Что реально связано со здоровьем школьника?\")\n"
   ]
  },
