    "library(caret)\n",
    "library(xgboost)\n",
    "library(dplyr)\n",
    "library(ggplot2)\n",
    "\n",
    "\n",
    "  \n",
    "  final_model_data <- df_wide %>%\n",
    "    mutate(\n",
    "      bmi = weight / ((height/100)^2),\n",
    "      is_healthy = factor(ifelse(health_score <= 2, \"Healthy\", \"Not_Healthy\"))\n",
    "    ) %>%\n",
    "    select(\n",
    "      is_healthy, bmi, hospital_3m, has_phone, pe_lessons, \n",
    "      sport_freq, grades, friends_meet, region, status\n",
    "    )\n",
    "\n",
    "# --- 1. СЕТКА ПАРАМЕТРОВ ---\n",
    "tune_grid <- expand.grid(\n",
    "  nrounds = 100, \n",
    "  max_depth = 2, \n",
    "  eta = 0.3, \n",
    "  gamma = 0, \n",
    "  colsample_bytree = 0.8, \n",
    "  min_child_weight = 1, \n",
    "  subsample = 0.8\n",
    ")\n",
    "\n",
    "# --- 2. ЦИКЛ ПЕРЕБОРА ВЕСОВ ---\n",
    "weights_to_test <- c(1, 2, 2.5, 3, 3.5, 4, 4.2)\n",
    "results_store <- data.frame()\n",
    "\n",
    "print(\"Начинаем поиск идеального баланса...\")\n",
    "\n",
    "for(w in weights_to_test) {\n",
    "  \n",
    "  # Используем tryCatch, чтобы одна ошибка не ломала весь цикл\n",
    "  try({\n",
    "    set.seed(123)\n",
    "    model <- train(is_healthy ~ ., \n",
    "                   data = final_model_data, \n",
    "                   method = \"xgbTree\",\n",
    "                   trControl = trainControl(method = \"cv\", number = 3),\n",
    "                   tuneGrid = tune_grid,\n",
    "                   scale_pos_weight = w,\n",
    "                   verbosity = 0)\n",
    "    \n",
    "    acc   <- model$results$Accuracy\n",
    "    kappa <- model$results$Kappa\n",
    "    \n",
    "    print(paste(\"Вес:\", w, \"-> Kappa:\", round(kappa, 4), \"| Acc:\", round(acc, 4)))\n",
    "    \n",
    "    results_store <- rbind(results_store, data.frame(Weight = w, Kappa = kappa, Accuracy = acc))\n",
    "  }, silent = TRUE)\n",
    "}\n",
    "\n",
    "# --- 3. РЕЗУЛЬТАТЫ ---\n",
    "if(nrow(results_store) > 0) {\n",
    "  best_weight <- results_store[which.max(results_store$Kappa), \"Weight\"]\n",
    "  print(\"------------------------------------------------\")\n",
    "  print(paste(\"ПОБЕДИТЕЛЬ: scale_pos_weight =\", best_weight))\n",
    "  print(\"------------------------------------------------\")\n",
    "  \n",
    "  # График\n",
    "  plot_obj <- ggplot(results_store, aes(x = Weight, y = Kappa)) +\n",
    "    geom_line(color = \"blue\", size = 1) +\n",
    "    geom_point(size = 3, color = \"red\") +\n",
    "    labs(title = \"Как балансировка влияет на качество?\",\n",
    "         x = \"Вес класса 'Больные' (scale_pos_weight)\",\n",
    "         y = \"Kappa (Качество)\") +\n",
    "    theme_minimal()\n",
    "    \n",
    "  print(plot_obj)\n",
    "} else {\n",
    "  print(\"Не удалось обучить модели. Проверьте данные.\")\n",
    "}\n"
   ]
  },
