    "\n",
    "# 2. Настройка контроля (теперь ориентируемся на ROC/Kappa, а не Accuracy)\n",
    "ctrl_balanced <- trainControl(method = \"cv\", \n",
    "                              number = 5, \n",
    "                              classProbs = TRUE,\n",
    "                              summaryFunction = defaultSummary) # Можно использовать twoClassSummary для ROC\n",
    "\n",
    "# 3. Обучение с весами (scale_pos_weight)\n",
    "# Мы передаем этот параметр прямо в XGBoost\n",
    "final_xgb_balanced <- train(is_healthy ~ ., \n",
    "                            data = final_model_data, \n",
    "                            method = \"xgbTree\",\n",
    "                            trControl = ctrl_balanced,\n",
    "                            tuneGrid = expand.grid(nrounds = 150, max_depth = 2, eta = 0.3, \n",
    "                                                   gamma = 0, colsample_bytree = 0.8, \n",
    "                                                   min_child_weight = 1, subsample = 0.8),\n",
    "                            scale_pos_weight = 1, \n",
    "                            verbosity = 0)\n",
    "\n",
    "# 4. Результаты\n",
    "# Смотрим Kappa\n",
    "best_res <- final_xgb_balanced$results\n",
    "print(paste(\"Новая Kappa:\", round(best_res$Kappa, 4)))\n",
    "\n",
    "# Матрица ошибок (покажет, сколько реально больных мы нашли)\n",
    "preds <- predict(final_xgb_balanced, final_model_data)\n",
    "confusionMatrix(preds, final_model_data$is_healthy)\n"
   ]
