    "# 1. Вытаскиваем лучшие результаты\n",
    "# caret хранит результаты всех экспериментов, нам нужен только победитель (bestTune)\n",
    "best_results <- final_xgb_balanced$results[as.numeric(rownames(final_xgb_balanced$bestTune)), ]\n",
    "\n",
    "# 2. Оценка стабильности (из 5 прогонов кросс-валидации)\n",
    "# final_xgb$resample хранит точность на каждом из 5 фолдов\n",
    "cv_accuracy <- final_xgb_balanced$resample$Accuracy\n",
    "mean_acc <- mean(cv_accuracy)\n",
    "sd_acc   <- sd(cv_accuracy)   # Стандартное отклонение (насколько результат \"гуляет\")\n",
    "\n",
    "# 3. Красивый вывод текстом\n",
    "cat(\"========================================================\\n\")\n",
    "cat(\"            ФИНАЛЬНЫЙ ОТЧЕТ ПО МОДЕЛИ XGBOOST           \\n\")\n",
    "cat(\"========================================================\\n\")\n",
    "cat(sprintf(\"Средняя точность (Accuracy):  %.2f%%\\n\", mean_acc * 100))\n",
    "cat(sprintf(\"Разброс (Std Dev):            +/- %.2f%%\\n\", sd_acc * 100))\n",
    "cat(sprintf(\"Коэффициент Каппа (Kappa):    %.4f\\n\", best_results$Kappa))\n",
    "cat(\"--------------------------------------------------------\\n\")\n",
    "cat(\"Интерпретация:\\n\")\n",
    "cat(\"Kappa > 0.2 говорит о том, что модель работает лучше случайного угадывания.\\n\")\n",
    "cat(sprintf(\"В 95%% случаев точность модели лежит в диапазоне: [%.1f%% - %.1f%%]\\n\", \n",
    "            (mean_acc - 2*sd_acc)*100, (mean_acc + 2*sd_acc)*100))\n",
    "cat(\"========================================================\\n\")\n",
    "\n",
    "# 4. Визуализация стабильности (Boxplot точности по фолдам)\n",
    "# Этот график показывает научруку, что результат не случаен\n",
    "results_df <- data.frame(Accuracy = cv_accuracy)\n",
    "\n",
    "ggplot(results_df, aes(y = Accuracy, x = \"\")) +\n",
    "  geom_boxplot(fill = \"lightblue\", alpha = 0.5) +\n",
    "  geom_jitter(width = 0.1, color = \"darkblue\", size = 3) +\n",
    "  labs(title = \"Стабильность модели (результаты 5 тестов)\",\n",
    "       subtitle = \"Каждая точка - один прогон кросс-валидации\",\n",
    "       y = \"Точность (Accuracy)\", x = \"\") +\n",
    "  theme_minimal() +\n",
    "  scale_y_continuous(labels = scales::percent)\n"
   ]
  },
