   "source": [
    "# --- ЭТАП 9: ИНТЕРПРЕТАЦИЯ (PDP GRAFICS) ---\n",
    "library(pdp)\n",
    "library(ggplot2)\n",
    "library(gridExtra) # Для объединения графиков\n",
    "\n",
    "# Функция для отрисовки красивого PDP\n",
    "plot_pdp <- function(model, var_name, class_label = \"Healthy\") {\n",
    "  \n",
    "  # Строим данные частичной зависимости\n",
    "  pd <- partial(model, pred.var = var_name, \n",
    "                prob = TRUE,                # Хотим вероятность, а не сырые баллы\n",
    "                which.class = class_label,  # Вероятность быть ЗДОРОВЫМ\n",
    "                train = final_model_data)   # Данные из последнего этапа\n",
    "  \n",
    "  # Рисуем\n",
    "  autoplot(pd) + \n",
    "    theme_minimal() +\n",
    "    labs(title = paste(\"Влияние\", var_name),\n",
    "         y = \"Вероятность быть здоровым\",\n",
    "         x = var_name) +\n",
    "    geom_line(color = \"darkblue\", size = 1.2) +\n",
    "    geom_smooth(method = \"loess\", se = FALSE, color = \"red\", linetype = \"dashed\", alpha=0.5) # Тренд\n",
    "}\n",
    "\n",
    "print(\"Генерируем графики... Это может занять минуту.\")\n",
    "\n",
    "# 1. PDP для BMI\n",
